import React, {Component} from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid, Hidden, Container } from '@material-ui/core';
import windowSize from 'react-window-size';
import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter,
  PropertyList,
  MapContainer
} from './components';
import './PropertySearch.css'

makeStyles(theme => ({
  root: {
    padding: theme.spacing(0), width: 800, 
  }
}));
const isDesktop = 0;
class PropertySearch extends Component {
  render(){
    console.log('props: ', this.props)
    if(isDesktop == 0){
      return (
        <div style={{maxWidth:800}}>
          <div style={{display:'flex', overflow:'hidden', overflowX: 'hidden'}}>
            <div className={makeStyles.root} style={{maxHeight: this.props.windowHeight - 75, overflow: 'auto', width:800}}>
                <Filter style={{padding:0}}></Filter>
                <Container style={{padding:20, width:'100%'}}>
                    <PropertyList></PropertyList>
                    <PropertyList></PropertyList>
              </Container>
            </div>

            <div>
                <MapContainer height={this.props.windowHeight-100} width={this.props.windowWidth-800}></MapContainer>
            </div>
          </div>
        </div>


        );
    } else {
        return(
            <div></div>
        );
    }
  };
  }


export default windowSize(PropertySearch);
